import "./styles.css";

export default function Card({
  nome,
  logo,
  estado,
  custo,
  valorMinimo,
  clientes,
  avaliacao,
}) {
  return (
    <div className="card-fornecedores">
      <div className="flex-row">
        <div
          className="logo-fornecedores"
          style={{
            backgroundImage: `url(${logo})`,
            backgroundPosition: "center center",
            backgroundSize: "cover",
          }}
        ></div>
        <h2>{nome}</h2>
        <button className="bt-secundario">Solicitar Orçamento</button>
      </div>
      <div className="flex-row infos-fornecedores">
        <spam className="flex-column content-center item-center">
          <p>UF:</p> {estado}
        </spam>
        <spam className="flex-column content-center item-center">
          <p>Custo em R$ por KWH:</p> {custo}
        </spam>
        <spam className="flex-column content-center item-center">
          <p>Número de clientes:</p> {clientes}
        </spam>
        <spam className="flex-column content-center item-center">
          <p>Avaliação média: </p>
          {avaliacao}
        </spam>
      </div>
    </div>
  );
}
